    false,nt"url": null,nt"notes": "Black Tern nest site selection and habitat
    availability were investigated in 1994 and 1995 at the Iroquois National Wildlife
    Refuge and adjoining Tonawanda and Oak Orchard State Wildlife Management Areas in
    western New York. Nest site selection was evaluated with a logistic regression model
    using habitat variables collected in 26 12-m radius circular nest plots and 31 random
    non-nest plots. Significant model variables were vegetation density, horizontal
    cover 0.5 m above the water, cover: wateru00b7 ratio, and water level.",nt"license_title":
